(function() {
  var Application,
    bind = function(fn, me){ return function(){ return fn.apply(me, arguments); }; };

  Application = (function() {
    Application.prototype.skrollrBody = 'wrapper';

    Application.prototype.forceHeight = false;

    function Application() {
      this.update = bind(this.update, this);
      this.keyframe = bind(this.keyframe, this);
      this.sk = skrollr.init(this);
      $('#p5-faq').animatedModal({
        animatedIn: 'zoomIn',
        animatedOut: 'zoomOut',
        modalTarget: 'faq',
        color: 'rgba(236, 232, 204, 0.95)',
        animationDuration: '0.3s'
      });
      this.update();
      $('.twitter-share-button').on('click', function() {
        var href, self;
        console.log(this.href);
        self = $(this);
        href = this.href + '?url=' + self.data('url') + '&text=' + self.data('text');
        window.open(encodeURI(decodeURI(href)), 'twittr', 'width=650, height=470, personalbar=0, toolbar=0, scrollbars=1, sizable=1');
        return false;
      });
    }

    Application.prototype.keyframe = function(element, name, direction) {
      var id;
      id = element.id;
      switch (id) {
        case 'steps':
          return this.manageSteps(element, name, direction);
        case 'step1-pic':
        case 'step2-pic':
        case 'step3-pic':
        case 'step4-pic':
          return this.manageStepPic(element, name, direction);
        default:
          return this.manageAnimation(element, name, direction);
      }
    };

    Application.prototype.manageAnimation = function(element, name, direction) {
      var a, target;
      target = $(element);
      a = target.data('animation');
      if (direction === 'down') {
        return target.addClass('animated ' + a);
      } else {
        return target.removeClass(a);
      }
    };

    Application.prototype.manageStepPic = function(element, name, direction) {
      var target;
      target = $(element);
      if (direction === 'down') {
        return target.addClass('animated bounceIn');
      } else {
        return target.removeClass('bounceIn');
      }
    };

    Application.prototype.manageSteps = function(element, name, direction) {
      return console.log(direction);
    };

    Application.prototype.update = function() {
      return requestAnimationFrame(this.update);
    };

    return Application;

  })();

  new Application();

}).call(this);
